function ImageComponent (props) {

    const UniversityPhoto = require(props.imagePath);
    return (
        // <View>
        //     <Image source={UniversityPhoto} alt='UniversityPhoto' width='100%' style={{ borderColor: 'black', borderWidth: 5 }} />
        // </View>
        <img src = {UniversityPhoto} width = '100%' style={{border:'1px solid black'}}/>
    )
}

export default ImageComponent;
